/*Table structure for table `tbl_category` */

DROP TABLE IF EXISTS `tbl_category`;

CREATE TABLE `tbl_category` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name_vi` text CHARACTER SET utf8,
  `name_en` text CHARACTER SET utf8,
  `name_jp` text CHARACTER SET utf8,
  `content_vi` longtext CHARACTER SET utf8,
  `content_en` longtext CHARACTER SET utf8,
  `content_jp` longtext CHARACTER SET utf8,
  `date` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `order` int(11) DEFAULT NULL,
  `id_hinhanh` int(11) DEFAULT NULL,
  `id_category` int(11) DEFAULT NULL,
  `role_show` varchar(50) DEFAULT NULL,
  `deleted` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;

