insert  into `tbl_category`(`id`,`name_vi`,`name_en`,`name_jp`,`content_vi`,`content_en`,`content_jp`,`date`,`order`,`id_hinhanh`,`id_category`,`role_show`,`deleted`) values (1,'ádxcvsdfsdf','','Bia Rượu','<p>cvvsdfsdfsdf</p>','','<p>&aacute;dxcvsdgwerwerqeqweqwefgdfg</p>',NULL,NULL,NULL,1,NULL,1),(2,'ádasdasdxc','','','','','',NULL,NULL,NULL,1,NULL,1),(3,'ádxcvsdqwe','','xcvsdasd','','','',NULL,NULL,NULL,6,NULL,1),(4,'THỰC PHẨM CHO BÉ','BABY FOOD','ベビーフード','<p>Sim Ba hiện đang ph&acirc;n phối c&aacute;c mặt h&agrave;ng ch&aacute;o ăn dặm v&agrave; b&aacute;nh ăn dặm sản xuất tại Nhật Bản của h&atilde;ng Kewpie, c&aacute;c mặt h&agrave;ng ch&aacute;o v&agrave; b&aacute;nh ăn dặm hiệu Peachy của Thiland;<br><br><br></p>','<p>xvsdfsdf</p>','','1531112961',NULL,1399,1,'1',0),(5,'THỦY SẢN CHẾ BIẾN','PROCESSED SEAFOOD','水産品','<p>N&oacute;i đến m&oacute;n ăn Nhật Bản, ai ai cũng biết m&oacute;n sushi v&agrave; sashimi. L&agrave;m sushi cũng l&agrave; một nghệ thuật, v&agrave; c&aacute;c nguy&ecirc;n liệu l&agrave;m sushi cũng hết sức phong ph&uacute;.</p>','','','1531112941',NULL,1411,6,NULL,0),(6,'BÁNH KẸO & SNACK','CONFECTIONERY','お菓子','<p>Nếu c&oacute; dịp dừng ch&acirc;n c&aacute;c s&acirc;n bay quốc tế Nhật Bản như Narita, bạn sẽ thấy rất nhiều kh&aacute;ch, đặc biệt l&agrave; kh&aacute;ch ch&acirc;u &Aacute;, xếp h&agrave;ng mua c&aacute;c mặt h&agrave;ng chocolate tr&agrave; xanh, chocolate trắng, chocolate tươi (nama chocolate)... của Nhật. C&aacute;c mặt h&agrave;ng b&aacute;nh kẹo Nhật Bản vừa hợp khẩu vị với người &Aacute; đ&ocirc;ng, kh&ocirc;ng qu&aacute; ngọt, lại vừa kết hợp c&aacute;c thế mạnh n&ocirc;ng nghiệp Nhật Bản như tr&agrave; xanh, sữa v&ugrave;ng Hokkaido, ... c&ugrave;ng với c&ocirc;ng nghệ sản xuất ti&ecirc;n tiến, v&agrave; đặc biệt l&agrave; với &oacute;c thẩm mỹ của m&igrave;nh, người Nhật đ&atilde; l&agrave;m bao b&igrave; rất hấp dẫn v&agrave; dễ thương. Bước v&agrave;o khu b&aacute;nh kẹo trong bất kỳ si&ecirc;u thị n&agrave;o tại Nhật, bạn sẽ muốn mua ngay lập tức...</p>','','','1531112958',NULL,1398,2,NULL,0),(7,'SẢN PHẨM TỪ SỮA','DAIRY PRODUCTS','乳製品','<p>Nhật Bản c&oacute; nhiều loại kem rất độc đ&aacute;o, rất &quot;Nhật Bản&quot;. C&oacute; lẽ ai đ&atilde; từng sống ở Nhật cũng đều biết loại kem mochi rất nổi tiếng- Yukimi Daifuku đặc trưng. C&oacute; nhiều loại kem kh&aacute; hợp khẩu vị người Việt như kem tắc Nhật (yuzu), kem m&egrave; đen, kem d&acirc;u rừng... V&agrave; tất nhi&ecirc;n l&agrave; kh&ocirc;ng thể thiếu kem tr&agrave; xanh.</p>','','','1531112951',NULL,1410,3,NULL,0),(8,'RƯỢU SAKE','JAPANESE SAKE','日本酒','<p>Rượu Sake (Nihonshu) l&agrave; một n&eacute;t văn ho&aacute; ẩm thực đặc sắc của người Nhật Bản, rượu được l&ecirc;n men từ những hạt ngọc trời của xứ sở hoa anh đ&agrave;o. C&aacute;ch thưởng thức Sake cũng rất đặt biệt so với c&aacute;c loại rượu kh&aacute;c, bạn c&oacute; thể uống khi nguội, khi lạnh hoặc h&acirc;m n&oacute;ng t&ugrave;y &yacute;, tuy nhi&ecirc;n, để thưởng thức hương vị tuyệt vời nhất của Sake, bạn n&ecirc;n giữ rượu ở nhiệt độ 12 - nhiệt độ ph&ograve;ng...</p>','','','1531112915',NULL,1414,25,NULL,0),(9,'ĐỒ UỐNG KHÔNG CỒN','NON-ALCOHOLIC DRINK','ノンアルコール飲料','','','','1531112925',NULL,1412,14,NULL,0),(10,'THỰC PHẨM CHẾ BIẾN','PROCESSED FOODS','加工食品','','','','1531112938',NULL,1435,8,NULL,0),(11,'RƯỢU TRÁI CÂY VÀ THỨC UỐNG CÓ CỒN KHÁC','FRUIT LIQUEURS & OTHER ALCOHOLIC DRINKS','ビール、その他','<p>Rượu tr&aacute;i c&acirc;y (Liquor) được pha chế từ một thức uống c&oacute; cồn v&agrave; được chưng cất, cải bi&ecirc;n hương vị với những nguy&ecirc;n liệu từ tr&aacute;i c&acirc;y, kem, dược thảo, gia vị, b&ocirc;ng hoa hay c&aacute;c loại hạch, c&oacute; th&ecirc;m đường hoặc c&aacute;c chất tạo ra vị ngọt...</p>','','','1531112899',NULL,1418,30,NULL,0),(12,'RƯỢU SHOCHU NHẬT BẢN','JAPANESE SHOCHU','焼酎','<p>Shochu (燒酒, しょうちゅう) l&agrave; một loại rượu trắng của Nhật Bản, được l&ecirc;n men rồi chưng cất từ l&uacute;a mạch, khoai v&agrave; gạo. Shochu c&oacute; rất nhiều loại với c&aacute;c độ cồn kh&aacute;c nhau. Tuy rượu Shochu kh&ocirc;ng ngọt bằng rượu Sake nhưng hương vị của n&oacute; cũng rất tuyệt. Kh&aacute;c biệt cơ bản nhất giữa Sake v&agrave; Shochu ở chỗ, Sake l&agrave; rượu l&ecirc;n men kh&ocirc;ng qua chưng cất c&ograve;n Shochu l&agrave; rượu đ&atilde; qua chưng cất...</p>','','','1531112912',NULL,1417,27,NULL,0),(13,'BIA - VODKA - GIN - WHISKY','BEER - VODKA - GIN - WHISKY','ビール、その他','<p>Whisky l&agrave; một loại đồ uống c&oacute; chứa cồn v&agrave; được sản xuất từ ngũ cốc bằng c&aacute;ch l&ecirc;n men v&agrave; chưng cất. Whisky Nhật Bản gần giống với Whisky của Scotland, Nikka v&agrave; Suntory l&agrave; hai nh&atilde;n rượu Whisky được ưa chuộng nhất tại Nhật Bản.</p>','','','1531112892',NULL,1422,30,NULL,1),(14,'Hàng tặng-Hàng mẫu','','','<p>test</p>','','','1540877305',NULL,NULL,4371,'7',0);

