/*Table structure for table `tbl_page` */

DROP TABLE IF EXISTS `tbl_page`;

CREATE TABLE `tbl_page` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `page` varchar(256) CHARACTER SET utf8 DEFAULT NULL,
  `module` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT ' ',
  `controller` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT 'index',
  `method` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT 'index',
  `seo_url` varchar(256) CHARACTER SET utf8 DEFAULT NULL,
  `template` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT 'template',
  `link` varchar(256) CHARACTER SET utf8 DEFAULT 'index/index',
  `param` varchar(256) CHARACTER SET utf8 DEFAULT NULL,
  `deleted` tinyint(9) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_page` */

insert  into `tbl_page`(`id`,`page`,`module`,`controller`,`method`,`seo_url`,`template`,`link`,`param`,`deleted`) values (1,'',' ','index','index','news/(:num)-(.*).html','template','index/news','$1',0),(2,'',' ','index','index','product/(:num)-(.*).html','template','index/product','$1',0),(3,'',' ','index','index','category/(:num)-(.*).html','template','index/category','$1',0),(4,'',' ','index','index','page/(:num)-(.*).html','template','index/page','$1',0);

/*Table structure for table `tbl_page_web` */

DROP TABLE IF EXISTS `tbl_page_web`;

CREATE TABLE `tbl_page_web` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(256) DEFAULT NULL,
  `alias` varchar(256) DEFAULT NULL,
  `content` longtext CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `date` varchar(256) DEFAULT NULL,
  `id_user` int(11) DEFAULT NULL,
  `active` int(11) DEFAULT '0',
  `deleted` int(10) unsigned DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_page_web` */

insert  into `tbl_page_web`(`id`,`title`,`alias`,`content`,`date`,`id_user`,`active`,`deleted`) values (12,'Co',NULL,'<p>Điều khoản hợp t&aacute;c</p>',NULL,NULL,1,1),(13,'',NULL,'<h2><strong>Sushi</strong></h2><p>Sushi l&agrave; một trong những m&oacute;n ăn truyền thống đặc sắc của người Nhật Bản. Ng&agrave;y nay, v&igrave; mức độ nổi tiếng của m&igrave;nh m&agrave; sushi xuất hiện ở mọi quốc gia tr&ecirc;n thế giới. Nguy&ecirc;n liệu ch&iacute;nh để l&agrave;m n&ecirc;n m&oacute;n sushi l&agrave; cơm trộn dấm kết hợp với c&aacute;c loại thức ăn như c&aacute; sống, trứng c&aacute;, hải sản tươi sống, rau củ, wasabi (m&ugrave; tạt).</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu.jpg\"><img alt=\"Sushi có rất nhiều loại để thực khách thưởng thức: Nigiri, Makizushi, Inarizushi, Chirashizushi, Oshizushi.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu.jpg\" title=\"Sushi có rất nhiều loại để thực khách thưởng thức: Nigiri, Makizushi, Inarizushi, Chirashizushi, Oshizushi.\" class=\"fr-dii fr-draggable\"></a></p><p>Sushi c&oacute; rất nhiều loại để thực kh&aacute;ch thưởng thức: Nigiri, Makizushi, Inarizushi, Chirashizushi, Oshizushi.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu1.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu1.jpg\"><img alt=\"Sushi có rất nhiều loại để thực khách thưởng thức: Nigiri, Makizushi, Inarizushi, Chirashizushi, Oshizushi.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu1.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu1.jpg\" title=\"Sushi có rất nhiều loại để thực khách thưởng thức: Nigiri, Makizushi, Inarizushi, Chirashizushi, Oshizushi.\" class=\"fr-dii fr-draggable\"></a></p><h2><strong>Takoyaki</strong></h2><p>Takoyaki l&agrave; b&aacute;nh bạch tuộc nướng đang rất được giới trẻ Việt Nam ưa th&iacute;ch, đ&acirc;y l&agrave; m&oacute;n ăn đường phố kh&aacute; phổ biến của người Nhật. Vi&ecirc;n b&aacute;nh được vo tr&ograve;n, nướng tr&ecirc;n bếp điện cho đến khi v&agrave;ng ươm. Loại b&aacute;nh n&agrave;y khi ăn lớp vỏ b&ecirc;n ngo&agrave;i gi&ograve;n, b&ecirc;n trong l&agrave; lớp bột b&aacute;nh mềm h&ograve;a lẫn với bạch tuộc gi&ograve;n sần sật.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu2.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu2.jpg\"><img alt=\"Điểm đặc biệt của bánh Takoyaki là phần cá bào gừng đỏ, nước sốt với cá bào sấy khô phủ bên ngoài tạo nên độ thơm ngon đậm đà của món ăn.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu2.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu2.jpg\" title=\"Điểm đặc biệt của bánh Takoyaki là phần cá bào gừng đỏ, nước sốt với cá bào sấy khô phủ bên ngoài tạo nên độ thơm ngon đậm đà của món ăn.\" class=\"fr-dii fr-draggable\"></a></p><p>Điểm đặc biệt của b&aacute;nh Takoyaki l&agrave; phần c&aacute; b&agrave;o gừng đỏ, nước sốt với c&aacute; b&agrave;o sấy kh&ocirc; phủ b&ecirc;n ngo&agrave;i tạo n&ecirc;n độ thơm ngon đậm đ&agrave; của m&oacute;n ăn.</p><h2><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu3.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu3.jpg\"><img alt=\"Điểm đặc biệt của bánh Takoyaki là phần cá bào gừng đỏ, nước sốt với cá bào sấy khô phủ bên ngoài tạo nên độ thơm ngon đậm đà của món ăn.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu3.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu3.jpg\" class=\"fr-dii fr-draggable\"></a></h2><h2><strong>Taiyaki</strong></h2><p>Taiyaki l&agrave; chiếc b&aacute;nh h&igrave;nh c&aacute; c&oacute; nhiều hoa văn, b&ecirc;n trong ẩn chứa nh&acirc;n đa dạng, nhưng hương vị truyền thống đặc trưng ch&iacute;nh l&agrave; đậu đỏ. Ng&agrave;y nay, m&oacute;n b&aacute;nh c&aacute; n&agrave;y c&ograve;n được s&aacute;ng tạo với nhiều hương vị kh&aacute;c nhau, c&oacute; cả nh&acirc;n ngọt, nh&acirc;n mặn hoặc cả kem lạnh b&ecirc;n trong.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu5.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu5.jpg\"><img alt=\"Khi thưởng thức Taiyaki, bạn sẽ thấy sự hòa quyện tuyệt vời giữa lớp vỏ bánh thơm lừng cùng nhân bên trong là lớp nhân đậm đà khá là thú vị đấy.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu5.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu5.jpg\" title=\"Khi thưởng thức Taiyaki, bạn sẽ thấy sự hòa quyện tuyệt vời giữa lớp vỏ bánh thơm lừng cùng nhân bên trong là lớp nhân đậm đà khá là thú vị đấy.\" class=\"fr-dii fr-draggable\"></a></p><p>Khi thưởng thức Taiyaki, bạn sẽ thấy sự h&ograve;a quyện tuyệt vời giữa lớp vỏ b&aacute;nh thơm lừng c&ugrave;ng nh&acirc;n b&ecirc;n trong l&agrave; lớp nh&acirc;n đậm đ&agrave; kh&aacute; l&agrave; th&uacute; vị đấy.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu6.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu6.jpg\"><img alt=\"Khi thưởng thức Taiyaki, bạn sẽ thấy sự hòa quyện tuyệt vời giữa lớp vỏ bánh thơm lừng cùng nhân bên trong là lớp nhân đậm đà khá là thú vị đấy.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu6.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu6.jpg\" class=\"fr-dii fr-draggable\"></a></p><h4><br></h4><h2><strong>Dorayaki</strong></h2><p>Dorayaki ch&iacute;nh l&agrave; chiếc b&aacute;nh r&aacute;n lừng danh m&agrave; m&egrave;o m&aacute;y Doraemon m&ecirc; mẩn. Nh&acirc;n b&aacute;nh truyền thống l&agrave; mứt đậu đỏ azuki, ng&agrave;y nay, người Nhật c&ograve;n kẹp b&aacute;nh r&aacute;n với mứt hạt dẻ, ph&ocirc; mai, kem ph&ocirc; mai, kem bơ để th&ecirc;m đa dạng. Hoặc nếu như bạn kh&ocirc;ng th&iacute;ch kẹp nh&acirc;n th&igrave; b&aacute;nh cũng c&oacute; thể ăn kh&ocirc;ng vẫn rất tuyệt.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu7.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu7.jpg\"><img alt=\"Dorayaki chính là chiếc bánh rán lừng danh mà mèo máy Doraemon mê mẩn.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu7.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu7.jpg\" title=\"Dorayaki chính là chiếc bánh rán lừng danh mà mèo máy Doraemon mê mẩn.\" class=\"fr-dii fr-draggable\"></a></p><p>Dorayaki ch&iacute;nh l&agrave; chiếc b&aacute;nh r&aacute;n lừng danh m&agrave; m&egrave;o m&aacute;y Doraemon m&ecirc; mẩn.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu8.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu8.jpg\"><img alt=\"Rất đẹp mắt và cũng rất ngon miệng.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu8.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu8.jpg\" title=\"Rất đẹp mắt và cũng rất ngon miệng.\" class=\"fr-dii fr-draggable\"></a></p><p>Rất đẹp mắt v&agrave; cũng rất ngon miệng.</p><h2><strong>Mochi</strong></h2><p>B&aacute;nh Mochi l&agrave; một trong những loại b&aacute;nh thượng hạng truyền thống của Nhật được du nhập v&agrave;o Việt Nam đ&atilde; nhiều năm. Đ&acirc;y l&agrave; chiếc b&aacute;nh truyền thống trong ng&agrave;y tết rất được người Nhật y&ecirc;u th&iacute;ch, với nh&acirc;n đậu đỏ tượng trưng cho sự may mắn v&agrave; thịnh vượng trong năm mới.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu9.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu9.jpg\"><img alt=\"Bánh Mochi là một trong những loại bánh thượng hạng truyền thống của Nhật được du nhập vào Việt Nam đã nhiều năm.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu9.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu9.jpg\" title=\"Bánh Mochi là một trong những loại bánh thượng hạng truyền thống của Nhật được du nhập vào Việt Nam đã nhiều năm.\" class=\"fr-dii fr-draggable\"></a></p><p>B&aacute;nh Mochi l&agrave; một trong những loại b&aacute;nh thượng hạng truyền thống của Nhật được du nhập v&agrave;o Việt Nam đ&atilde; nhiều năm.</p><p>Nguy&ecirc;n liệu để l&agrave;m b&aacute;nh kh&ocirc;ng c&oacute; g&igrave; kh&aacute;c ngo&agrave;i gạo, nhưng phải d&ugrave;ng loại gạo nếp ngọt v&agrave; dẻo, người Nhật gọi l&agrave; gạo Mochi. V&igrave; được l&agrave;m từ gạo dẻo n&ecirc;n b&aacute;nh Mochi c&oacute; độ kết d&iacute;nh rất cao. B&aacute;nh được l&agrave;m bằng 3 lớp nguy&ecirc;n liệu: B&ecirc;n ngo&agrave;i l&agrave; lớp bột gạo mochi thượng hạng, ch&iacute;nh giữa l&agrave; lớp m&ugrave;i vị pha với đậu Nhật, b&ecirc;n trong c&ugrave;ng l&agrave; kem lạnh.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu10.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu10.jpg\"><img alt=\"Nguyên liệu để làm bánh không có gì khác ngoài gạo, nhưng phải dùng loại gạo nếp ngọt và dẻo, người Nhật gọi là gạo Mochi\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu10.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu10.jpg\" title=\"Nguyên liệu để làm bánh không có gì khác ngoài gạo, nhưng phải dùng loại gạo nếp ngọt và dẻo, người Nhật gọi là gạo Mochi\" class=\"fr-dii fr-draggable\"></a></p><p>Nguy&ecirc;n liệu để l&agrave;m b&aacute;nh kh&ocirc;ng c&oacute; g&igrave; kh&aacute;c ngo&agrave;i gạo, nhưng phải d&ugrave;ng loại gạo nếp ngọt v&agrave; dẻo, người Nhật gọi l&agrave; gạo Mochi</p><h2><strong>Okonomiyaki</strong></h2><p>Okonomiyaki hay c&ograve;n được biết với t&ecirc;n gọi gần gũi l&agrave; b&aacute;nh x&egrave;o Nhật Bản, đ&acirc;y l&agrave; một m&oacute;n b&aacute;nh mặn &aacute;p chảo gồm nhiều loại nguy&ecirc;n liệu. T&ecirc;n của b&aacute;nh được gh&eacute;p từ okonomi nghĩa l&agrave; thứ bạn th&iacute;ch/muốn v&agrave; yaki nghĩa l&agrave; nấu nướng. Đ&acirc;y l&agrave; m&oacute;n b&aacute;nh đặc trưng của v&ugrave;ng Kansai hoặc Hiroshima.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu11.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu11.jpg\"><img alt=\"Okonomiyaki hay còn được biết với tên gọi gần gũi là bánh xèo Nhật Bản\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu11.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu11.jpg\" title=\"Okonomiyaki hay còn được biết với tên gọi gần gũi là bánh xèo Nhật Bản\" class=\"fr-dii fr-draggable\"></a></p><p>Okonomiyaki hay c&ograve;n được biết với t&ecirc;n gọi gần gũi l&agrave; b&aacute;nh x&egrave;o Nhật Bản</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu12.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu12.jpg\"><img alt=\"Đây là món bánh đặc trưng của vùng Kansai hoặc Hiroshima.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu12.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu12.jpg\" title=\"Đây là món bánh đặc trưng của vùng Kansai hoặc Hiroshima.\" class=\"fr-dii fr-draggable\"></a></p><p>Đ&acirc;y l&agrave; m&oacute;n b&aacute;nh đặc trưng của v&ugrave;ng Kansai hoặc Hiroshima.</p><h2><strong>Beef/Chicken Korokke</strong></h2><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu13.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu13.jpg\"><img alt=\"Beef Korokke - bánh khoai tây thịt bò\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu13.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu13.jpg\" title=\"Beef Korokke - bánh khoai tây thịt bò\" class=\"fr-dii fr-draggable\"></a></p><p>Beef Korokke &ndash; b&aacute;nh khoai t&acirc;y thịt b&ograve;</p><p>Nếu bạn l&agrave; một t&iacute;n đồ của văn h&oacute;a ẩm thực Nhật Bản th&igrave; chắc hẳn sẽ kh&ocirc;ng thể bỏ qua gợi &yacute; n&agrave;y. Beef Korokke &ndash; b&aacute;nh khoai t&acirc;y thịt b&ograve; l&agrave; những vi&ecirc;n b&aacute;nh với lớp vỏ ngo&agrave;i gi&ograve;n rụm b&ecirc;n trong l&agrave; nh&acirc;n khoai t&acirc;y trộn lẫn với thịt b&ograve; nhuyễn mịn n&oacute;ng hổi vừa thổi vừa ăn, đảm bảo sẽ đ&aacute;nh gục được bạn ngay từ lần thử đầu ti&ecirc;n.</p><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu14.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu14.jpg\"><img alt=\"Nếu bạn không thích mùi vị thịt bò thì đã có ngay vị Chicken curry, sẽ không lo bị ngán nhé.\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu14.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu14.jpg\" class=\"fr-dii fr-draggable\"></a></p><p>Nếu bạn kh&ocirc;ng th&iacute;ch m&ugrave;i vị thịt b&ograve; th&igrave; đ&atilde; c&oacute; ngay vị Chicken curry, sẽ kh&ocirc;ng lo bị ng&aacute;n nh&eacute;.</p><h2><strong>Pudding</strong></h2><p><a data-cke-saved-href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu15.jpg\" href=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu15.jpg\"><img alt=\"Món tráng miệng Pudding\" data-cke-saved-src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu15.jpg\" src=\"https://cdn3.ivivu.com/2015/01/am-thuc-nhat-ban-ivivu15.jpg\" title=\"Món tráng miệng Pudding\" class=\"fr-dii fr-draggable\"></a></p><p>M&oacute;n tr&aacute;ng miệng Pudding</p><p>Sau khi đ&atilde; thưởng thức no n&ecirc; những loại b&aacute;nh ở tr&ecirc;n th&igrave; chắc hẳn một m&oacute;n tr&aacute;ng miệng mang đậm hương vị Nhật Bản như pudding sẽ l&agrave; sự lựa chọn tuyệt vời nhất. Với hương vị b&eacute;o b&eacute;o thơm thơm của v&aacute;ng sữa, c&ugrave;ng c&aacute;c nguy&ecirc;n liệu đi k&egrave;m được chọn lọc kh&aacute;c nhau, như: Tr&agrav