google.com/maps/place/124+Tr%C6%B0%E1%BB%9Dng+Chinh,+Ph%C6%B0%E1%BB%9Dng+12,+T%C3%A2n+B%C3%ACnh,+H%E1%BB%93+Ch%C3%AD+Minh/@10.794543,106.6486223,17z/data=!3m1!4b1!4m5!3m4!1s0x3175294af6105e2f:0x25f46566962ee9f8!8m2!3d10.794543!4d106.650811\" target=\"_blank\">(Bản đồ hướng dẫn đường)</a></p><p><strong>Thời gian mở cửa:</strong>&nbsp;</p><p><br></p><ul><li><strong><span><strong>T2 đến T7</strong>:<span>&nbsp;</span></span></strong><span>9h đến 20h30</span></li><li><strong>CN</strong>: 8h30 đến 17h30</li></ul><p><strong>C&Aacute;CH 3:</strong>&nbsp;<strong>ĐẶT H&Agrave;NG TR&Ecirc;N WEBSITE&nbsp;</strong></p><p><br></p><p>Qu&yacute; Kh&aacute;ch đặt h&agrave;ng tr&ecirc;n website theo hướng dẫn sau:</p><p><strong>Bước 1:</strong> Truy cập website &nbsp;<a href=\"https://babi.vn/\"></a><a href=\"https://babi.vn/\">https://babi.vn/</a> , chọn danh mục sản phẩm cần mua hoặc g&otilde; v&agrave;o &ocirc; t&igrave;m kiếm để t&igrave;m c&aacute;c sản phẩm theo t&iacute;nh năng: chất liệu, kiểu d&aacute;ng, theo m&ugrave;a, Lễ, Tết..</p><p><img alt=\"\" src=\"https://babi.vn/images/companies/1/untitled%20folder/huong-dan-moi1.png?1504236887969\" class=\"fr-dii fr-draggable\"></p><p>Bước 2: Bấm v&agrave;o h&igrave;nh ảnh sản phẩm cần mua để xem th&ocirc;ng tin chi tiết của sản phẩm.</p><p>*Mẹo: CHỌN ĐỒ NHANH HƠN khi lọc theo k&iacute;ch cỡ, gi&aacute;, họa tiết, chất liệu, ...</p><p><img alt=\"\" src=\"https://babi.vn/images/companies/1/untitled%20folder/huong-dan-moi2-1.png?1504246482079\" class=\"fr-dii fr-draggable\"></p><p>Bước 3: Tiến h&agrave;nh th&ecirc;m sản phẩm cho v&agrave;o giỏ h&agrave;ng</p><p><strong>1. Xem m&ocirc; tả sản phẩm v&agrave; gi&aacute; b&aacute;n</strong>&nbsp;</p><p><strong>2. Chọn k&iacute;ch cỡ theo c&acirc;n nặng của b&eacute;</strong></p><p>* Vui l&ograve;ng click v&agrave;o h&igrave;nh tam gi&aacute;c m&agrave;u đen <span>▼<span>&nbsp;</span></span><span>để chọn size cần mua cho b&eacute;.</span></p><p><strong>3. Chọn m&agrave;u sắc sản phẩm</strong></p><p>* &nbsp;C&aacute;c k&iacute;ch cỡ c&ograve;n size: h&igrave;nh sản phẩm s&aacute;ng m&agrave;u được th&ecirc;m v&agrave;o giỏ h&agrave;ng.&nbsp;</p><p>* &nbsp;C&aacute;c k&iacute;ch cỡ hết size: h&igrave;nh sản phẩm hiện m&agrave;u đen l&agrave; đ&atilde; hết m&agrave;u hết size vui l&ograve;ng chọn k&iacute;ch cỡ kh&aacute;c để th&ecirc;m v&agrave;o giỏ h&agrave;ng.</p><p><strong>4. Chọn số lượng</strong></p><p>* Vui l&ograve;ng click v&agrave;o h&igrave;nh tam gi&aacute;c m&agrave;u đen <span>▼&nbsp;</span><span>để chọn số lượng muốn mua cho b&eacute;.</span></p><p><strong>5. Bấm n&uacute;t &quot;TH&Ecirc;M V&Agrave;O GIỎ&quot;&nbsp;</strong></p><p><img alt=\"\" src=\"https://babi.vn/images/companies/1/untitled%20folder/huong-dan-moi3.png?1504239372720\" class=\"fr-dii fr-draggable\"></p><p>&nbsp;</p><p>Bước 4: Bấm n&uacute;t &quot;ĐẶT H&Agrave;NG&quot; để nhập th&ocirc;ng tin mua h&agrave;ng.</p><p><img alt=\"\" src=\"https://babi.vn/images/companies/1/untitled%20folder/huong-dan-moi4.png?1504240151519\" class=\"fr-dii fr-draggable\"></p><p>Bước 5: Xem lại th&ocirc;ng tin đơn h&agrave;ng cột tr&aacute;i.</p><p>Nhập Số điện thoại, t&ecirc;n v&agrave; Bấm n&uacute;t &quot;HO&Agrave;N TẤT ĐẶT H&Agrave;NG&quot; để kết th&uacute;c.</p><p>Qu&yacute; kh&aacute;ch giữ m&aacute;y, Babi sẽ gọi x&aacute;c nhận đơn h&agrave;ng từ 9h - 17h30 hằng ng&agrave;y.&nbsp;</p><p><img alt=\"\" src=\"https://babi.vn/images/companies/1/untitled%20folder/huong-dan-moi5.png?1504240493868\" class=\"fr-dii fr-draggable\"></p><p align=\"center\">Cần hỗ trợ th&ecirc;m vui l&ograve;ng gọi đến tổng đ&agrave;i <strong>1900 54 54 77</strong> hoặc gửi th&ocirc;ng tin về địa chỉ email:<a href=\"mailto:hotro@babi.vn\">hotro@babi.vn</a>. &nbsp;Cảm ơn Qu&yacute; Kh&aacute;ch !</p>','1546135734',5,1,0),(21,'Phương thức thanh toán',NULL,'<p><span><span><strong>C&Aacute;CH 1.</strong></span><span>&nbsp;</span><span><strong>MUA H&Agrave;NG V&Agrave; THANH TO&Aacute;N TẠI CỬA H&Agrave;NG BABI